            blip.Color = BlipColor.Blue;
          if (num >= 200 && num < 300)
            blip.Color = BlipColor.Red;
          if (num >= 300 && num < 400)
            blip.Color = BlipColor.Yellow;
          if (num >= 400 && num < 500)
            blip.Color = BlipColor.Green;
          if (num >= 500 && num < 600)
            blip.Color = BlipColor.RedDark;
          if (num >= 600 && num < 700)
            blip.Color = BlipColor.BlueDark;
          if (num >= 700 && num < 800)
            blip.Color = BlipColor.YellowDark;
          if (num >= 800 && num < 900)
            blip.Color = BlipColor.GreenDark;
          if (num >= 900 && num < 1000)
            blip.Color = BlipColor.BlueLight;
          if (num >= 1000 && num < 1100)
            blip.Color = BlipColor.RedLight;
          if (num >= 1100 && num < 1200)
            blip.Color = BlipColor.Green2;
          if (num >= 1200 && num < 1300)
            blip.Color = BlipColor.MenuYellow;
        }
        if (this.UseDefaultWhiteColor)
          blip.Color = BlipColor.White;
        if (this.UseSpecificColor)
          blip.Color = this.BlipColor;
        blip.Scale = 1f;
        this.InteriorBlips.Add(blip);
        Script.Wait(1);
      }
    }

